  `uid` int(11) NOT NULL COMMENT '用户ID',
  `lower_id` int(11) DEFAULT NULL COMMENT '下级ID',
  `type` tinyint(1) NOT NULL COMMENT '类型 1：日常任务奖励、2：额外任务奖励、3：分享奖励、4：充值提成；5中心分享奖励；6中心业绩奖励;7:分销奖励；8:分红补贴',
  `money` decimal(8,2) NOT NULL DEFAULT '0.00' COMMENT '奖励金额',
  `game_coin` decimal(8,2) NOT NULL DEFAULT '0.00' COMMENT '奖励游戏币',
  `order_id` char(24) DEFAULT NULL COMMENT '订单号：年月日时分秒+毫秒+6位ID',
  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '奖励发放时间',
  `remarks` varchar(50) DEFAULT NULL COMMENT '备注说明',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=12463 DEFAULT CHARSET=utf8 COMMENT='奖励表(分红、任务奖励、推荐奖励)';

