-- ----------------------------
-- Table structure for tg_staff
-- ----------------------------
DROP TABLE IF EXISTS `tg_staff`;
CREATE TABLE `tg_staff` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '自增主键ID',
  `staff_name` varchar(20) DEFAULT NULL COMMENT '推广专员的昵称',
  `staff_real` varchar(20) DEFAULT NULL COMMENT '推广专员的真实姓名',
  `staff_pwd` char(32) NOT NULL DEFAULT '' COMMENT '登陆密码',
  `mobile` char(11) NOT NULL COMMENT '推广专员的手机号',
  `card_id` varchar(30) DEFAULT NULL COMMENT '推广专员的身份证号码',
  `referee` int(11) DEFAULT NULL COMMENT '推荐此推广专员的id',
  `recommend_num` int(11) DEFAULT '0' COMMENT '推荐的推广专员总人数',
  `game_id` int(20) DEFAULT NULL COMMENT '推广专员的游戏账号',
  `money` decimal(10,4) DEFAULT '0.0000' COMMENT '推广专员的账户余额',
  `consume_coin` decimal(10,4) NOT NULL DEFAULT '0.0000' COMMENT '推广专员的消费币',
  `income` decimal(10,4) NOT NULL DEFAULT '0.0000' COMMENT '总收入',
  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '推广专员的注册时间',
  `status` tinyint(1) NOT NULL COMMENT '状态:\r\n1是正常；2禁用；3：未完善信息',
  `is_service` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否是兑换中心',
  `is_league` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否是加盟商',
  `address` varchar(255) DEFAULT NULL COMMENT '地址',
  `pay_status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '状态:\r\n1是等待付款；2付款失败；3付款成功 ;',
  `service_number` int(11) DEFAULT NULL COMMENT '所属中心id',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2127 DEFAULT CHARSET=utf8 COMMENT='推广专员表';

