  `class` tinyint(1) DEFAULT NULL COMMENT '加盟商等级',
  `credit_value` int(10) DEFAULT '100' COMMENT '信用值',
  `credit_num` int(10) DEFAULT '0' COMMENT '完成任务次数',
  `recharge_ratio` float(10,0) DEFAULT '0' COMMENT '充值业绩奖励比例',
