-- ----------------------------
-- Table structure for tg_task
-- ----------------------------
DROP TABLE IF EXISTS `tg_task`;
CREATE TABLE `tg_task` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(60) NOT NULL DEFAULT '' COMMENT '任务名称',
  `type` tinyint(1) NOT NULL COMMENT '任务类型;1:基本任务、2:额外任务',
  `detail` varchar(200) NOT NULL DEFAULT '' COMMENT '任务描述',
  `class` tinyint(1) NOT NULL COMMENT '领取此任务的等级所需要的加盟商等级 \r\n0：没有等级限制\r\n1：一级加盟商\r\n2：二级加盟商\r\n3：三级加盟商',
  `isgame` tinyint(1) NOT NULL COMMENT '是否游戏任务 0:否、1:是',
  `inneed` int(10) NOT NULL DEFAULT '0' COMMENT '任务指标',
  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '任务创建时间',
  `money` decimal(8,2) NOT NULL COMMENT '任务金额',
  `tasker` varchar(20) NOT NULL COMMENT '创建此任务的管理员',
  `status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '任务状态  0:未发布、1:已发布 、-1:已删除',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=25 DEFAULT CHARSET=utf8 COMMENT='任务列表';

-- ----------------------------
-- Records of tg_task
-- ----------------------------

-- ----------------------------
-- Table structure for tg_task_done
-- ----------------------------
DROP TABLE IF EXISTS `tg_task_done`;
CREATE TABLE `tg_task_done` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键自增ID',
  `task_id` int(11) NOT NULL COMMENT '任务ID',
  `uid` int(11) NOT NULL COMMENT '用户ID',
  `inneed` int(10) NOT NULL COMMENT '完成指标',
  `get_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '任务领取时间',
  `done_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '任务完成时间',
  `status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '状态 0：未领取；1：进行中；2：已完成；3：未完成；-1：已删除；8：结算数据',
  `reward` decimal(8,2) DEFAULT NULL COMMENT '上级分销的钱 = 充值业绩成 * 20% * 50%',
  `get_money` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否发放奖励 0：未发（任务未完成）1：待发（任务完成至少一次）；2：已发。',
  `task_count` tinyint(1) NOT NULL DEFAULT '0' COMMENT '领取游戏次数',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=335 DEFAULT CHARSET=utf8 COMMENT='已完成任务列表';

-- ----------------------------
-- Records of tg_task_done
-- ----------------------------

