  `end_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '结束时间',
  `tasker` varchar(20) NOT NULL COMMENT '发布此任务的管理员',
  `status` tinyint(1) NOT NULL COMMENT '状态 1：进行中；2：已过期；3：下周任务',
  PRIMARY KEY (`id`)
