DROP PROCEDURE IF EXISTS `pro_cash`;
DELIMITER ;;
CREATE DEFINER=`tuiguang`@`192.168.0.%` PROCEDURE `pro_cash`(IN `in_id` int,IN `in_fact_money` decimal,IN `in_game_coin` decimal,IN `in_type` tinyint,IN`in_money` decimal,IN`in_order_id` char(24),IN`into_type` tinyint)
BEGIN
	#Routine body goes here...
DECLARE t_error INTEGER DEFAULT 0;
DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;
START TRANSACTION;
UPDATE tg_staff SET money = money + in_fact_money,consume_coin = consume_coin + in_game_coin,income = income + in_money WHERE id = in_id;
IF t_error = 1 THEN
	ROLLBACK;
ELSE
	COMMIT;
END IF;
SELECT t_error;
END
;;
DELIMITER ;

